    [DefaultProperty("Text")]
    [ToolboxData("<{0}:LocationPicker runat=server></{0}:LocationPicker>")]
    public class LocationPicker : WebControl, INamingContainer
    {
        [Bindable(true)]
        [Category("Appearance")]
        [DefaultValue("")]
        [Localizable(true)]
        public string Text
        {
            get
            {
                return SelectedProvice + "-" + SelectedCity + "-" + SelectedAred;
            }
        }

        private HiddenField txtProvice ;
        private HiddenField txtCity ;
        private HiddenField txtArea ;
        private const string jsName = "LocationPicker.js";
        private static bool isChecked = false;
        /// <summary>
        /// 获取或设置选中的省份
        /// </summary>
        [
        Category("属性"),
        Description("获取或设置选中的省份")]
        public string SelectedProvice 
        {
            get 
            {
                return txtProvice.Value;
            }
            set 
            {
                
                txtProvice.Value = value;
            }
        }
        public override ControlCollection Controls
        {
            get
            {
                //确定服务器是否包含子控件 
                EnsureChildControls();
                return base.Controls;
            }
        }
        /// <summary>
        /// 获取或设置选中的城市
        /// </summary>
        [
        Category("属性"),
        Description("获取或设置选中的城市")]
        public string SelectedCity
        {
            get
            {
                return txtCity.Value;
            }
            set
            {
                txtCity.Value = value;
            }
        }

        /// <summary>
        /// 获取或设置选中的地区
        /// </summary>
        [
        Category("属性"),
        Description("获取或设置选中的地区")]
        public string SelectedAred
        {
            get
            {
                return txtArea.Value;
            }
            set
            {
                txtArea.Value = value;
            }
        }
        /// <summary>
        /// 省的选择下拉框
        /// </summary>
        [Description("省的选择下拉框"),
       Category("控件指定")
        , NotifyParentProperty(true),
     TypeConverter(typeof(SelectControlFilter))]
        public string ProviceSelecter 
        {
            get 
            {
                return ViewState["ProviceSelecter"] as string;
            }
            set 
            {
                ViewState["ProviceSelecter"] = value;
            }
        }
        /// <summary>
        /// 市的选择下拉框
        /// </summary>
        [Description("市的选择下拉框"),
       Category("控件指定")
        , NotifyParentProperty(true),
