        {
            get
            {
                return ViewState["CitySelecter"] as string;
            }
            set
            {
                ViewState["CitySelecter"] = value;
            }
        }

        /// <summary>
        /// 区的选择下拉框
        /// </summary>
        [Description("区的选择下拉框"),
       Category("控件指定")
        , NotifyParentProperty(true),
