        {
            get
            {
                return ViewState["AreaSelecter"] as string;
            }
            set
            {
                ViewState["AreaSelecter"] = value;
            }
        }

        /// <summary>
        /// 初始化中转值的控件
        /// </summary>
        private void InitTextControl() 
        {
            if (txtProvice == null)
            {
                txtProvice = new HiddenField();
                txtCity = new HiddenField();
                txtArea = new HiddenField();
                txtProvice.ID = "txtProvice";
                txtCity.ID = "txtCity";
                txtArea.ID = "txtArea";
            }
        }

        protected override void Render(HtmlTextWriter writer)
        {
            writer.Write("<div style=\"display:none;width:" + this.Width + ";height:" + this.Height + "\">");
            base.Render(writer);
            writer.Write("</div>");
        }

        protected override void CreateChildControls()
        {
            this.Controls.Clear();
            
            //txtProvice.RenderControl(writer);
            //txtCity.RenderControl(writer);
            //txtArea.RenderControl(writer);
            
            this.Controls.Add(txtProvice);
            this.Controls.Add(txtCity);
            this.Controls.Add(txtArea);
            base.CreateChildControls();
        }

        protected override void OnLoad(EventArgs e)
        {
            base.OnLoad(e);

            SaveJs();

            if (!Page.ClientScript.IsClientScriptIncludeRegistered(jsName+"Include"))
            {
                Page.ClientScript.RegisterClientScriptInclude(jsName+"Include", JsSaver.GetDefualtJsUrl(jsName));
            }
            
        }
        /// <summary>
        /// 保存成JS文件
        /// </summary>
        private void SaveJs()
        {
            if (!isChecked)
            {
                JsSaver.SaveJS(jsName, CreateJs());
                isChecked = true;
            }
        }
        public override void RenderEndTag(HtmlTextWriter writer)
        {
            base.RenderEndTag(writer);

            
            if (!Page.ClientScript.IsStartupScriptRegistered("Init"))
            {
                string provinceId = GetControlClientID(ProviceSelecter);
                string cityId = GetControlClientID(CitySelecter);
                string areaId = GetControlClientID(AreaSelecter);

                string hidProvince = txtProvice.ClientID;
                string hidCity = txtCity.ClientID;
                string hidArea = txtArea.ClientID;

                string js = "var obj" + this.ClientID + "Loc=new LocationPicker(\"" + provinceId + "\",\"" + cityId + "\",\"" + areaId + "\",\"" + hidProvince + "\",\"" + hidCity + "\",\"" + hidArea + "\");";
                Page.ClientScript.RegisterStartupScript(this.GetType(), "Init", js, true);
            }
        }

        /// <summary>
        /// 获取控件的客户端ID
        /// </summary>
        /// <param name="id">控件ID</param>
        /// <returns></returns>
        private string GetControlClientID(string id) 
        {

            Control ctrProvice = WebPageCommon.FindControl(id, this.Parent);
            if (ctrProvice == null) 
            {
                return "";
            }
            
            return ctrProvice.ClientID;
        }
        
        public LocationPicker() 
        {
            InitTextControl();
            this.Width = 80;
            this.Height = 20;
        }

